create table flightLogs (
	flightNumber INT,
	departureAirportCode VARCHAR(50),
	arrivalAirportCode VARCHAR(50),
	departureDatetime DATE,
	arrivalDatetime DATE,
	flightDurationMinutes INT,
	airlineName VARCHAR(50),
	aircraftType VARCHAR(12),
	passengerCount INT,
	ticketPrice VARCHAR(50),
	creditCardNumber VARCHAR(50),
	creditCardType VARCHAR(50),
	pilotName VARCHAR(50)
);
